80000;     // 20m - 118s(count down) - 2m(buffer)\n    private timer: any;\n    private timestamp: any;\n\n    init() {\n        this.timestamp = new Date();\n        this.initWatcher(() => {\n            this.showWarnTimeoutModal();\n        }, this.warnTime);\n    }\n\n    initWatcher(action, timeout) {\n        this.timer = setTimeout(() => {\n            action();\n        }, timeout);\n    }\n\n    exdentSession () {\n        clearTimeout(this.timer);\n        this.init();\n    }\n\n    showWarnTimeoutModal() {\n        this.sessionTimedOut = false;\n        this.timeoutMessageIsVisible = true;\n        const diffTime: number = this.timeout - this.warnTime;\n        this.initWatcher(() => {\n            this.showTimeoutModal();\n        }, diffTime);\n    }\n\n    showTimeoutModal() {\n        this.sessionTimedOut = true;\n        this.timeoutMessageIsVisible = true;\n    }\n\n    continueSession() {\n        clearTimeout(this.timer);\n        this.timeoutMessageIsVisible = false;\n        this.initWatcher(() => {\n            this.showWarnTimeoutModal();\n        }, this.warnTime);\n    }\n\n    endSession() {\n        window.open('/manager/logout', '_self');\n    }\n}\n\n    \n\n    \n        \n\n\t\n\t\t\n\t\t\t\n\t\t\t\tALERT: SESSION HAS ENDED\n\t\t\t\tALERT: SESSION TIMEOUT WARNING\n\t\t\t\n\t\t\t\n\t\t\t\tYour session has ended due to no activity on this screen. Please re-login. You will need to restart a new session after login\n\t\t\t\tYour session will timeout in 2 min, due to no activity on this screen. If you wish to continue your session please click CONTINUE to keep your session active.\n\t\t\t\n\t\t\t\n\t\t\t\tLOGIN  \n\t\t\t\tCONTINUE  \n\t\t\t\n\t\t\n\t\n\n\n    \n\n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\